      <div className='col-span-4 row-span-1'>
        <ProfileForm
          firstName=''
          lastName=''
          about=''
          github=''
          email={currentUserProp.email}
        />
        <DeleteAccount currentUser={currentUserProp} />
      </div>
    </div>
  );
};
